def setContentType():
    print("Length: " + str(len(strMap)))

    for key in strMap:
        isReplayMsgExist = strMap.get(key)['replyTo'] in strMap
        print(isReplayMsgExist)
        if strMap.get(key)['replyTo'] is None or not isReplayMsgExist:
            strMap.get(key)['contentType'] = 'post'
            strMap.get(key)['esId'] = strMap.get(key)['url'] + '_' + str(strMap.get(key)['originalId'])
            strMap.get(key)['replyTo'] = None
        else:
            strMap.get(key)['contentType'] = 'comment'
            strMap.get(key)['esId'] = strMap.get(key)['url'] + '_' + str(strMap.get(key)['originalId'])

    # print(strMap)

